commit_message:
add create_and_list_image benchmark

Added create_and_list_image benchmark.
Config example is below.

{
    "GlanceImages.create_and_list_image": [
        {
            "args": {
                "image_url": "http://download.cirros-cloud.net/0.3.1/cirros-0.3.1-x86_64-disk.img",
                "container_format": "bare",
                "disk_format": "qcow2"
            },
            "runner": {
                "type": "continuous",
                "times": 10,
                "active_users": 1
            },
            "context": {
                "users": {
                    "tenants": 1,
                    "users_per_tenant": 1
                }
            }
        }
    ]
}

Change-Id: I2cd71444e7a6e7ee8fb206f1750a3bd988760afb

