commit_message:
Rework documentation of notifications

- move notifications docs from inputs and outputs to separate page;
- listeners and TransitionNotifier documented;
  - docstrings improved, missing docstrings added;
  - documentation put to notifications page;
- inputs and outputs page edited.

Change-Id: Ib283836173a806fbec81aa07b3292e2672bf6483

Verify the response attributes of 'show_host_detail'

This patch verifies the response attributes of 'show_host_detail'.
The response body of v2 and v3 API has the same format:

"host": [
{
"resource": {
"cpu": 1,
"disk_gb": 1028,
"host": "5ca60c6792a1442f9471ff575443f94d",
"memory_mb": 8192,
"project": "(total)"
}
}
]

Partially implements blueprint nova-api-attribute-test
Change-Id: I1b9e698a97d487541abb26aea10fa20e79448f84

